script: |
  super -f text -I q9547.spq | sort > q9547.out

inputs:
  - name: q9547.spq
    data: |
      SELECT - + col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col0 - col2 * - + col0 NOT IN ( + - col0, col0, - 76 / - col2, col0 * + 68 );
  - name: tab1

outputs:
  - name: q9547.out
    data: |
      -59
      -68
      -96
